window.bookSummaryJSON = "<p><i>New York Times</i> best seller Pepper Winters delivers another delicious dark romance. </p> <p>\"I'm not the hero in this story, girl. You'd do best to remember that.\" </p> <p>Once upon a time, I was an 18-year-old psychology student. </p> <p>Now, I'm a man's property. </p> <p>Stolen and sold, I've been decorated in bruises since the day my world changed two years ago. </p> <p>I suffer in silence, I crave freedom, but I never break. </p> <p>I can't. </p> <p>Until he arrives. </p> <p>Elder Prest, the only man to look at me and see me. The only man more ruthless than my owner. </p> <p>He wants me for reasons I don't understand. </p> <p>He claims me for one night then leaves and never looks back. </p> <p>Until he returns. </p> <p>And life becomes much more complicated. </p>"; 
